import React, { useEffect, useState, useMemo, useCallback } from 'react';
import api from '../services/api';
import { useNavigate } from 'react-router-dom';
import { useTable, useGlobalFilter, useSortBy } from 'react-table';
import { motion } from 'framer-motion';
import { Edit2, Trash2 } from 'lucide-react';
import { toast } from 'react-toastify';

export default function EnrollmentList() {
  const [enrolls, setEnrolls] = useState([]);
  const [globalFilter, setGlobalFilter] = useState('');
  const navigate = useNavigate();

  useEffect(() => {
    api.get('/matriculas/')
      .then(res => setEnrolls(res.data))
      .catch(() => toast.error('Error al cargar matrÃ­culas'));
  }, []);

  const deleteOne = useCallback(async (id) => {
    if (!window.confirm('Â¿Eliminar esta matrÃ­cula?')) return;
    await api.delete(`/matriculas/${id}/`);
    toast.success('MatrÃ­cula eliminada');
    const res = await api.get('/matriculas/');
    setEnrolls(res.data);
  }, []);

  const data = useMemo(() => enrolls, [enrolls]);
  const columns = useMemo(() => [
    { Header: 'Estudiante ID', accessor: 'estudiante' },
    { Header: 'Curso', accessor: 'curso' },
    { Header: 'Semestre', accessor: 'semestre' },
    { Header: 'Fecha', accessor: 'fecha' },
    {
      Header: 'Comprobante',
      accessor: 'comprobante',
      Cell: ({ cell: { value } }) => (
        <a href={value} target="_blank" rel="noopener noreferrer" className="text-blue-600 underline">
          Ver
        </a>
      )
    },
    {
      Header: 'Acciones',
      id: 'actions',
      Cell: ({ row }) => (
        <div className="flex space-x-2">
          <button onClick={() => navigate(`/enrollments/edit/${row.original.id}`)} className="hover:text-yellow-600">
            <Edit2 size={18} />
          </button>
          <button onClick={() => deleteOne(row.original.id)} className="hover:text-red-600">
            <Trash2 size={18} />
          </button>
        </div>
      )
    }
  ], [navigate, deleteOne]);

  const {
    getTableProps,
    getTableBodyProps,
    headerGroups,
    rows,
    prepareRow
  } = useTable(
    { columns, data, initialState: { globalFilter } },
    useGlobalFilter,
    useSortBy
  );

  return (
    <motion.div className="p-4 bg-white rounded-lg shadow" initial={{ opacity: 0 }} animate={{ opacity: 1 }}>
      <div className="flex justify-between items-center mb-4">
        <h2 className="text-xl font-semibold">MatrÃ­culas</h2>
        <button onClick={() => navigate('/enrollments/new')} className="bg-green-600 text-white px-4 py-2 rounded hover:bg-green-700">
          Nuevo
        </button>
      </div>

      <input
        type="text"
        placeholder="Buscar..."
        value={globalFilter}
        onChange={e => setGlobalFilter(e.target.value)}
        className="mb-4 p-2 border rounded w-full"
      />

      <table {...getTableProps()} className="w-full table-auto">
        <thead className="bg-gray-100">
          {headerGroups.map(hg => (
            <tr {...hg.getHeaderGroupProps()} key={hg.id}>
              {hg.headers.map(col => (
                <th
                  {...col.getHeaderProps(col.getSortByToggleProps())}
                  key={col.id}
                  className="p-2 text-left cursor-pointer"
                >
                  {col.render('Header')}
                  {col.isSorted ? (col.isSortedDesc ? ' ðŸ”½' : ' ðŸ”¼') : ''}
                </th>
              ))}
            </tr>
          ))}
        </thead>
        <tbody {...getTableBodyProps()}>
          {rows.map(row => {
            prepareRow(row);
            return (
              <tr {...row.getRowProps()} key={row.original.id} className="hover:bg-gray-50">
                {row.cells.map(cell => (
                  <td {...cell.getCellProps()} key={cell.column.id} className="p-2">
                    {cell.render('Cell')}
                  </td>
                ))}
              </tr>
            );
          })}
        </tbody>
      </table>
    </motion.div>
  );
}
